Atheist Activist! Tales From the Trenches of the Freethought Movement by Joe Zamecki

Joe Zamecki is a veteran Atheist activist, a grassroots organizer, and a loudmouth for the Freethought movement. He spent eight years as a full time employee of American Atheists Inc., and worked for ten years beyond that to help the movement grow and prosper. This is an in-depth look at the movement behind the scenes, from the perspective of an ex-Christian Atheist activist, capital &quot;A.&quot;

PDF VERSION ONLY
